import React, { Component } from 'react';

class UserFilters extends Component<any, any> {

  render() {
    // const { name, picture, login, phone, registered, location, uniqueID, gender, dob, clickOnCard } = this.props;

    return (
      <div className="filters">
        <div className="filter-block">
          <span className="filter-block__title">Gender</span>
          <select className="filter-block__select">
            <option>Male</option>
            <option>Female</option>
          </select>
        </div>
        <div className="filter-block">
          <span className="filter-block__title">Sorting by age</span>
          <select className="filter-block__select">
            <option>Ascending </option>
            <option>Descending</option>
          </select>
        </div>
      </div>
    )
  }
}

export default UserFilters;
